<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\SecurityDomain\Domain\SecurityDomainRef;
use Civi\Lughauth\Features\Access\SecurityScope\Domain\SecurityScopeRef;
use Civi\Lughauth\Features\Access\ScopeAssignation\Domain\ValueObject\ScopeAssignationSecurityDomainVO;
use Civi\Lughauth\Features\Access\ScopeAssignation\Domain\ValueObject\ScopeAssignationSecurityScopeVO;
use Civi\Lughauth\Features\Access\ScopeAssignation\Domain\ValueObject\ScopeAssignationVersionVO;
use Civi\Lughauth\Features\Access\ScopeAssignation\Domain\ScopeAssignationAttributes;
use PHPUnit\Framework\TestCase;

final class ScopeAssignationAttributesUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new ScopeAssignationAttributes();
        $securityDomainOneValue = $this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['one'])->getMock();
        $securityDomainOtherValue = $this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['other'])->getMock();
        $copy = $value->securityDomain($securityDomainOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityDomain());
        $this->assertNotEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityDomain());
        $this->assertEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityDomainOrDefault(ScopeAssignationSecurityDomainVO::from($securityDomainOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityDomainOrDefault(ScopeAssignationSecurityDomainVO::from($securityDomainOtherValue))->value());
        $value->unsetSecurityDomain();
        $this->assertEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityDomainOrDefault(ScopeAssignationSecurityDomainVO::from($securityDomainOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityDomainOrDefault(ScopeAssignationSecurityDomainVO::from($securityDomainOtherValue))->value());
        $securityScopeOneValue = $this->getMockBuilder(SecurityScopeRef::class)->setConstructorArgs(['one'])->getMock();
        $securityScopeOtherValue = $this->getMockBuilder(SecurityScopeRef::class)->setConstructorArgs(['other'])->getMock();
        $copy = $value->securityScope($securityScopeOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals($this->getMockBuilder(SecurityScopeRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityScope());
        $this->assertNotEquals($this->getMockBuilder(SecurityScopeRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityScope());
        $this->assertEquals($this->getMockBuilder(SecurityScopeRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityScopeOrDefault(ScopeAssignationSecurityScopeVO::from($securityScopeOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(SecurityScopeRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityScopeOrDefault(ScopeAssignationSecurityScopeVO::from($securityScopeOtherValue))->value());
        $value->unsetSecurityScope();
        $this->assertEquals($this->getMockBuilder(SecurityScopeRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityScopeOrDefault(ScopeAssignationSecurityScopeVO::from($securityScopeOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(SecurityScopeRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityScopeOrDefault(ScopeAssignationSecurityScopeVO::from($securityScopeOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(ScopeAssignationVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(ScopeAssignationVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(ScopeAssignationVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(ScopeAssignationVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
